def destroy(self):
        del self._objs
        del self._type2objs
        del self._count2types

    def getTypes(self):
        return list(self._type2objs.keys())

    def getObjsOfType(self, type):
        return self._type2objs.get(type, [])

    def printObjsOfType(self, type):
        for obj in self._type2objs.get(type, []):
            print(repr(obj))
